import axios from 'axios';

export const agmarknetController = async (req, res) => {
    const { offset } = req.query;
    try {
        const response = await axios.get(
            'https://api.data.gov.in/resource/9ef84268-d588-465a-a308-a864a43d0070',
            {
                params: {
                    'api-key': '579b464db66ec23bdd000001a349e2e3517944ba781b776b9d7fa71f',
                    format: 'json',
                    offset,
                    limit: 10
                },
            }
        );

        res.json(response.data.records);
    } catch (error) {
        console.error('API Fetch Error:', error.message);
        res.status(500).json({ error: 'Failed to fetch Agmarknet data' });
    }
}


export const weatherController = async (req, res) => {
    try {
        const { lat, lon, exclude = 'minutely,hourly', units = 'metric' } = req.query;

        if (!lat || !lon) {
            return res.status(400).json({ error: 'Latitude and longitude are required' });
        }

        const apiKey = 'c222bccbe6011e1870ad8d99a9ccf1e7';

        const response = await axios.get('https://api.openweathermap.org/data/3.0/onecall', {
            params: {
                lat,
                lon,
                exclude,
                units,
                appid: apiKey,
            },
        });

        res.status(200).json(response.data);
    } catch (error) {
        console.error('Weather API error:', error.message);
        res.status(500).json({ error: 'Failed to fetch weather data' });
    }
};


export const cropHealthController = async (req, res) => {
    try {

        /**
            request data format : {
  "images": [
    "data:image/jpeg;base64,"
],
"latitude": 49.207,
"longitude": 16.608,
"similar_images": true
}
         */
        const requestData = req.body; // Expecting data from frontend

        const config = {
            method: 'post',
            url: 'https://crop.kindwise.com/api/v1/identification',
            headers: {
                'Api-Key': 'bZR7i221cJDoE8A69UEPAQpVuXDbqePmYhAMDV7x5L96BOaCeJ',
                'Content-Type': 'application/json'
            },
            data: requestData,
            maxBodyLength: Infinity,
        };

        const response = await axios(config);

        res.status(200).json(response.data);
    } catch (error) {
        console.error('Crop Health API Error:', error.message);
        res.status(500).json({
            error: 'Failed to fetch crop health data',
            details: error.response?.data || error.message
        });
    }
};
